import { Breadcrumb } from "react-bootstrap";

function BreadCrumb({ items }) {
  return (
    <Breadcrumb className="bread-crumb">
      {items.map((item, id) => (
        <Breadcrumb.Item
          key={id}
          href={item.href ? item.href : "/"}
          active={item.active}
          className="bread-crumb-item"
        >
          {item.label}
        </Breadcrumb.Item>
      ))}
    </Breadcrumb>
  );
}

export default BreadCrumb;
